import { Container } from '@mui/material'
import React from 'react'

function PlayStore() {
  return (
    <Container sx={{
        maxWidth: "1200px",
        margin: "0 auto",
        padding: "40px 20px 50px",
        height:'60px',
        backgroundColor: "#e3f2fd",
        marginTop:"10px"
    }}>

    </Container>
  )
}

export default PlayStore
